ax, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2591733","type":"CustomJS"},{"attributes":{"label":{"value":"Final (5%)"},"renderers":[{"id":"2591497"}]},"id":"2591515","type":"LegendItem"},{"attributes":{"source":{"id":"2591454"}},"id":"2591460","type":"CDSView"},{"attributes":{"data":{"Close":{"__ndarray__":"zczMzMxMQUCPwvUoXA9BQJqZmZmZ+UBArkfhehTuQEBI4XoUrsdAQHE9CtejkEBAw/UoXI+CQECkcD0K18NAQMP1KFyPokBAw/UoXI+iQEA9CtejcL1AQHsUrkfhmkBAj8L1KFzvQEDNzMzMzKxAQOF6FK5HIUFACtejcD2qQECPwvUoXM8/QKRwPQrXYz9ASOF6FK4HQEDNzMzMzEw/QMP1KFyPAj9A9ihcj8L1P0BSuB6F6zFAQNejcD0Klz5AexSuR+G6PkCPwvUoXI8/QGZmZmZm5j9AUrgehesRQEDhehSuRwFAQGZmZmZmRkBAFK5H4Xo0QEBcj8L1KFxAQOxRuB6FK0BA4XoUrkdBQEDhehSuR+E/QOF6FK5HoT9AAAAAAADAP0DD9Shcj4I/QHsUrkfhej9ArkfhehQuP0DD9Shcj0I/QArXo3A9Sj9AFK5H4XoUP0DD9ShcjyJAQAAAAAAAAEBACtejcD0KQEAAAAAAAABAQHE9CtejMEBAKVyPwvUoQEApXI/C9ehAQHE9Ctej8EBACtejcD1KQEBI4XoUrmdAQFK4HoXrsUBAhetRuB5lQEBI4XoUrudAQI/C9Shcj0BApHA9CtdjQECF61G4HiVAQHE9CtejUEBASOF6FK5nQED2KFyPwpVAQOxRuB6Fi0BAj8L1KFyPQEAK16NwPcpAQEjhehSux0BA7FG4HoWrQEDD9Shcj+JAQGZmZmZmRkFAmpmZmZlZQUBcj8L1KHxBQMP1KFyPIkFAhetRuB4FQUAUrkfhenRBQGZmZmZmJkFA9ihcj8IVQUBSuB6F67FAQPYoXI/CtUBAAAAAAABgQUAK16NwPYpBQH
